Two and a Half Men is an American television comedy series which premiered on CBS on September 22, 2003. The sitcom stars Charlie Sheen, Jon Cryer and Angus T. Jones. The show is about a hedonistic jingle writer, Charlie; his uptight brother, Alan; and Alan's young son, Jake. Charlie's free-wheeling life is complicated and altered when his brother gets divorced and moves into Charlie's beach-front house. There have been six seasons of Two and a Half Men; the seventh season is currently showing. CBS renewed the show for an additional three seasons. The show is consistently ranked one of the most watched comedies every season in the United States.
